import styles from './Nav.module.css'

export function Nav() {
  return (
    <nav>
        <div className={styles.content}>
            <button className={styles.link}>Work</button>
            <button href="https://www.google.com/" className={styles.link}>Posts</button>
            <button href="https://www.google.com/" className={styles.link}>Contact</button>
        </div>
    </nav>
  );
}
